import GameList from "../GameList/GameList";
import './App.css';
import React from 'react';
import SearchBar from "../Game Search Bar/searchBar";
import ServerConnection from '../Api Connection/serverConnection'
import mainPageImage from "./mainPageImage";
import aiImage from 'ai-machine-learning.png'

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      games: []
    };

    // this.searchAPI = this.searchAPI.bind(this);
    this.getQuizzes = this.getQuizzes.bind(this);
    this.getQuizzes();


  }
  getQuizzes() {
    ServerConnection.getQuizzes().then(games => {
      this.setState( {games: games});
    });
  }

  render() {
    return (
        <div className="app">
          <h1>Trivia Game</h1>
          <img src={aiImage} alt="AI image"/>
          <GameList games={this.state.games}/>
        </div>
    )
  }


}

  // searchAPI(quiz, jwtToken) {
